We have to make a monadic translation of all Rust sub-expressions as most of them might have side effects, mainly a memory mutation, allocation, or panic. This makes the generated code much more verbose than the original Rust code. For example, the "Hello World!" program in Rust: fn main() { // Statements here are executed when the compiled binary is called // Print text to the console println!("Hello World!");
} is currently translated to: Definition main : M unit := let* _ : M.Val unit := let* _ : M.Val unit := let* Î±0 : ref str.t := M.read (mk_str "Hello World!
") in let* Î±1 : M.Val (array (ref str.t)) := M.alloc [ Î±0 ] in let* Î±2 : core.fmt.Arguments.t := M.call (core.fmt.Arguments.t::["new_const"] (pointer_coercion "Unsize" (borrow Î±1))) in let* Î±3 : unit := M.call (std.io.stdio._print Î±2) in M.alloc Î±3 in M.alloc tt in let* Î±0 : M.Val unit := M.alloc tt in M.read Î±0. with a lot of intermediate variables Î±0, Î±1, Î±2, Î±3 that are not present in the original code. They are introduced by the monadic translation to name the result of all sub-expressions but clutter the generated code. Using a Coq tactic that we are finalizing, we generate the following code: Definition main : M unit := ltac:(M.monadic (( let _ : unit := let _ : M.Val unit := M.alloc (| M.call (|(std.io.stdio._print (M.call (|(core.fmt.Arguments.t::["new_const"] (pointer_coercion "Unsize" (borrow (M.alloc (| [ M.read (| mk_str "Hello World!
" |) ] |))))) |))) |) |) in M.alloc (| tt |) in tt ) : unit)). The monadic translation is done in the tacticÂ M.monadic. The result should be more similar to the original source code, by nesting sub-expressions instead of naming intermediate results.

