The new translation of coq-of-rust integrates the changes that we proposed in the previous milestone, which was about "analyzing what to improve". The goal is to be able to translate almost any Rust projects, with minimal or no modifications. Here is an example of input Rust code: fn main() { println!("Hello World!");
} We now translate it to: Definition main (Ï„ : list Ty.t) (Î± : list Value.t) : M := match Ï„, Î± with | [], [] => ltac:(M.monadic (M.read (| let _ := let _ := M.alloc (| M.call_closure (| M.get_function (| "std::io::stdio::_print", [] |), [ M.call_closure (| M.get_associated_function (| Ty.path "core::fmt::Arguments", "new_const", [] |), [ (* Unsize *) M.pointer_coercion (M.alloc (| Value.Array [ M.read (| M.mk_str "Hello World!
" |) ] |)) ] |) ] |) |) in M.alloc (| Value.Tuple [] |) in M.alloc (| Value.Tuple [] |) |))) | _, _ => M.impossible end. This translation is much more verbose, but also more reliable, than the translation that we used to have: Definition main : M unit := let* _ : M.Val unit := let* _ : M.Val unit := let* Î±0 : ref str.t := M.read (mk_str "Hello World!
") in let* Î±1 : M.Val (array (ref str.t)) := M.alloc [ Î±0 ] in let* Î±2 : core.fmt.Arguments.t := M.call (core.fmt.Arguments.t::["new_const"] (pointer_coercion "Unsize" (borrow Î±1))) in let* Î±3 : unit := M.call (std.io.stdio._print Î±2) in M.alloc Î±3 in M.alloc tt in let* Î±0 : M.Val unit := M.alloc tt in M.read Î±0. We now quickly detail the changes, that were also presented in the previous milestone report as ongoing work.
